import React from 'react'
import Navbar from 'react-bootstrap/Navbar';

function AppBar(props) {
  console.log(props.props)
  return (
    <Navbar bg="dark" variant="dark">
    <Navbar.Brand href="#home">
   {props.props}
      
    </Navbar.Brand>
  </Navbar>
  )
}

export default AppBar
